import React from "react";

function CheckoutPage() {
  return (
    <div className="flex items-center justify-center h-screen bg-gray-100">
      <div className="bg-white p-10 rounded-2xl shadow-lg w-[400px] text-center">
        <img
          src="https://b.stripecdn.com/docs-statics-srv/assets/checkout-hosted-hover.180c6ab2498a8c65daefb5bedae835bf.png"
          alt="Checkout Preview"
          className="w-full mb-6 rounded-lg"
        />
        <h2 className="text-2xl font-bold mb-4">Checkout</h2>
        <p className="mb-6 text-gray-600">
          This is a demo checkout page (no payment processing).
        </p>
        <button
          className="bg-blue-600 text-white py-2 px-6 rounded-xl hover:bg-blue-700 transition"
          onClick={() => alert("Order placed successfully!")}
        >
          Confirm Order
        </button>
      </div>
    </div>
  );
}

export default CheckoutPage;
